// max min (house - heater)

class Solution {
public:
	int findRadius(vector<int>& houses, vector<int>& heaters) {
		
		sort(begin(houses), end(houses));
		sort(begin(heaters), end(heaters));

		int n = houses.size(),
			m = heaters.size();

		int i = 0, j = 0;

		int maxDist = 0;
		for (int i = 0; i < n; ++i) {
			
			int d = numeric_limits<int>::max();

			d = min(d, abs(houses[i] - heaters[0]));
			d = min(d, abs(houses[i] - heaters[m - 1]));

			auto r = equal_range(begin(heaters), end(heaters), houses[i]);
			if (r.first != end(heaters)) {
				d = min(d, abs(houses[i] - *r.first));
				++r.first;
				if (r.first != end(heaters))
					d = min(d, abs(houses[i] - *r.first));
			}
			if (r.second != end(heaters)) {
				d = min(d, abs(houses[i] - *r.second));
				if (r.second != begin(heaters)) {
					--r.second;
					d = min(d, abs(houses[i] - *r.second));
				}
			}

			//auto rit = lower_bound(begin(heaters), end(heaters), houses[i]);
			//if (rit != end(heaters))
			//	d = min(d, abs(houses[i] - *rit));

			maxDist = max(maxDist, d);
		}
		return maxDist;
	}
};

